import { useMediaQuery } from '../hooks/useMediaQuery';
import { IconRotatedLogoProps } from '../types/props';

export const IconRotatedLogo = ({
	rotation = 0,
	width = 68.7,
	mirrorY = false,
	hideable = false,
	top = 'auto',
	right = 'auto',
	bottom = 'auto',
	left = 'auto',
}: IconRotatedLogoProps) => {
	const isHidden = useMediaQuery('(max-width: 1480px)');

	let svgTransform = `rotate(${rotation}deg)`;

	if (mirrorY) {
		svgTransform = `scale(1, -1) ${svgTransform}`;
	}

	const height = width * 1.1;

	const svgStyle: React.CSSProperties = {
		position: 'absolute',
		aspectRatio: width / height,
		transform: svgTransform,
		width: width,
		top: top,
		right: right,
		bottom: bottom,
		left: left,
	};

	const hidden = isHidden && hideable;

	return (
		<>
			{!hidden && (
				<svg
					width={width}
					height={height}
					viewBox={`0 0 ${width} ${height}`}
					fill='none'
					xmlns='http://www.w3.org/2000/svg'
					xmlnsXlink='http://www.w3.org/1999/xlink'
					style={svgStyle}
				>
					<rect
						width={width}
						height={height}
						rx='34.3553'
						fill='url(#pattern0_1133_3016)'
						fillOpacity='0.18'
					/>
					<defs>
						<pattern
							id='pattern0_1133_3016'
							patternContentUnits='objectBoundingBox'
							width='1'
							height='1'
						>
							<use
								xlinkHref='#image0_1133_3016'
								transform='matrix(0.00414938 0 0 0.00376256 0 0.0353244)'
							/>
						</pattern>
						<image
							id='image0_1133_3016'
							width='241'
							height='247'
							preserveAspectRatio='none'
							xlinkHref='data:image/png;base64,'
						/>
					</defs>
				</svg>
			)}
		</>
	);
};
